import React from "react";
import {useState, useEffect} from "react";

function Todo(){

    const [data, setData]= useState([])
    const apiGet = ()=>{
        fetch('http://localhost:1337/api/notice')
        .then((response)=>response.json())
        .then((json)=>{
            console.log(json);
            setData(json);
        })
    }

    useEffect(()=>{
        apiGet();
    },[])



    return (
        <div>
            <h1>Hi</h1>
            <h2>NOTICE</h2>
            <ul>
                {data.map((item) => (
                    <li key={item.id}>{item.name}</li>
                ))}
            </ul>
        </div>
    )
}

export default Todo

